class ProjectUpdateMemberRequestModel {  int? manageProjectId;  int? manageProjectStaffId;  int? manageProjectRoleId;  ProjectUpdateMemberRequestModel(      {this.manageProjectId,        this.manageProjectStaffId,        this.manageProjectRoleId});  ProjectUpdateMemberRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectId = json['manage_project_id'];    manageProjectStaffId = json['manage_project_staff_id'];    manageProjectRoleId = json['manage_project_role_id'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_id'] = this.manageProjectId;    data['manage_project_staff_id'] = this.manageProjectStaffId;    data['manage_project_role_id'] = this.manageProjectRoleId;    return data;  }}